import React from 'react';
import Slider from 'react-slick';
import './TrendingDesigns.css';
import image10 from '../../assets/images/trending1.jpg';
import image11 from '../../assets/images/trending2.jpg';
import image12 from '../../assets/images/trending3.jpg';
import image13 from '../../assets/images/trending4.jpg';
import image14 from '../../assets/images/trending5.jpg';

const TrendingDesigns = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
          infinite: true,
          dots: true
        }
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };

  const images = [
    { src: image10, alt: "OBSIDIAN BANK", price: "$8", rating: 4.5 },
    { src: image11, alt: "EUREKA VISION THEATER", price: "$20", rating: 4.5 },
    { src: image12, alt: "ROSETON BUILDING", price: "$15", rating: 4.5 },
    { src: image13, alt: "TITAN PLAZA", price: "$25", rating: 4.5 },
    { src: image14, alt: "NEXUS TOWER", price: "$12", rating: 4.5 }
  ];

  return (
    <section className="trending-designs">
      <h2>Trending Designs</h2>
      <Slider {...settings}>
        {images.map((image, index) => (
          <div key={index} className="design-card">
            <img src={image.src} alt={image.alt} />
            <div className="design-info">
              <h3>{image.alt}</h3>
              <span className="price">{image.price}</span>
              <div className="rating">
                {Array.from({ length: Math.round(image.rating) }, (_, i) => (
                  <span key={i} className="star">&#9733;</span>
                ))}
              </div>
            </div>
          </div>
        ))}
      </Slider>
    </section>
  );
};

export default TrendingDesigns;
